import React from "react";
import Card from "./Card";
import "./Cards.css";
import book from "../../media/untitled_book.png";

import { useHistory } from "react-router-dom";

const Cards = () => {
  let history = useHistory();
  console.log(history);
  let handleCreateClick = () => {
    console.log("CreateBook Clicked");
    history.push("/desk/create");
  };
  const recents = [
    {
      title: "maths",
      src: "data:image/jpeg;base64,",
    },
    {
      title: "physics",
      src: "data:image/png;base64,",
    },
    {
      title: "chemistry",
      src: "data:image/jpeg;base64,",
    },
  ];

  recents.map((card) => <Card title={card.title} src={card.src} />);

  return (
    <div>
      <div className="cardInfo">
        <p className="textNew">New</p>
        <p className="textRecent">recent</p>
      </div>
      <div className="Cards">
        <Card
          key={-1}
          title="Create Book"
          src={book}
          className="createCard"
          handleCreateClick={handleCreateClick}
        />

        <>
          {recents.map((card, id) => (
            <Card key={id} title={card.title} src={card.src} />
          ))}
        </>
      </div>
    </div>
  );
};

export default Cards;
